INSERT INTO `news` (`id`, `tytul`, `tresc`, `data_publikacji`, `autor_id`, `status`, `zdjecie`) VALUES
(1, 'Nowoczesne wyposażenie naszego szpitala', 'Nasz szpital stale inwestuje w nowoczesny sprzęt medyczny, aby zapewnić pacjentom najlepszą możliwą opiekę. Dzięki najnowszym technologiom diagnostycznym i terapeutycznym możemy skuteczniej leczyć nawet najbardziej skomplikowane przypadki.', '2025-05-25 18:19:17', 15, 'opublikowany', 'uploads/news/683343054b0b2.jpg'),
(2, 'Zespół doświadczonych specjalistów', 'W naszym szpitalu pracuje zespół wykwalifikowanych lekarzy, pielęgniarek i personelu medycznego, którzy codziennie dbają o zdrowie i bezpieczeństwo pacjentów. Ich wiedza i zaangażowanie to nasza największa siła.', '2025-05-25 18:19:35', 15, 'opublikowany', 'uploads/news/683343177141a.jpg'),
(3, 'Tytuł: Komfort i bezpieczeństwo pacjentów', 'Dbamy nie tylko o skuteczność leczenia, ale także o komfort naszych pacjentów. Nasze oddziały są wyposażone tak, aby pobyt w szpitalu był jak najbardziej przyjazny i bezstresowy.', '2025-05-25 18:20:00', 15, 'opublikowany', 'uploads/news/683343302ad70.jpg'),
(4, 'Programy profilaktyczne i edukacyjne', 'Szpital realizuje liczne programy profilaktyczne oraz edukacyjne, które mają na celu promowanie zdrowego stylu życia oraz wczesne wykrywanie chorób. Zachęcamy do uczestnictwa i korzystania z naszych bezpłatnych badań.', '2025-05-25 18:20:15', 15, 'opublikowany', 'uploads/news/6833433f3adcc.jpg'),
(5, 'Współpraca z lokalną społecznością', 'Jesteśmy dumni z naszej współpracy z lokalnymi instytucjami i organizacjami. Razem organizujemy akcje zdrowotne i wydarzenia, które mają na celu poprawę stanu zdrowia mieszkańców naszego regionu.', '2025-05-25 18:20:33', 15, 'opublikowany', 'uploads/news/683343510ace4.jpg'),
(6, 'Dostępność usług medycznych 24/7', 'Nasz szpital zapewnia całodobową opiekę medyczną, dzięki czemu pacjenci mogą liczyć na pomoc w nagłych wypadkach o każdej porze dnia i nocy. Jesteśmy zawsze gotowi, by nieść pomoc.', '2025-05-25 18:20:50', 15, 'opublikowany', 'uploads/news/68334362a7c7d.jpeg'),
(7, 'Innowacyjne metody leczenia', 'Wprowadzamy nowoczesne, innowacyjne metody leczenia, które zwiększają skuteczność terapii i skracają czas rekonwalescencji. Nasz personel regularnie szkoli się, aby stosować najnowsze osiągnięcia medycyny.', '2025-05-25 18:21:06', 15, 'opublikowany', 'uploads/news/68334372a53d5.jpg');

